
CREATE TABLE IF NOT EXISTS public.airport_data(
    uuid UUID PRIMARY KEY,
    airport  VARCHAR(200) NULL,
    airport_iata  VARCHAR(200) NULL
);


CREATE TABLE IF NOT EXISTS public.flight_data(
    uuid UUID PRIMARY KEY,
    departure_time TIMESTAMP WITH TIME ZONE NULL,
    airline VARCHAR(200) NULL,
    origin_airport  VARCHAR(200) NULL,
    origin_iata  VARCHAR(200) NULL,
    destination_airport VARCHAR(200) NULL,
    destination_iata VARCHAR(200) NULL,
    stops VARCHAR(30) NULL,
    price FLOAT NULL
);



CREATE TABLE IF NOT EXISTS public.chw_chw(
    uuid UUID PRIMARY KEY,
    region VARCHAR(200) NULL
);

CREATE TABLE IF NOT EXISTS public.chw_patient(
    uuid UUID PRIMARY KEY,
    patient_uuid UUID NULL
);

CREATE TABLE IF NOT EXISTS public.chw_patient_assessment(
    uuid UUID PRIMARY KEY,
    date DATE NULL,
    chw_id VARCHAR(200) NULL,
    patient_uuid VARCHAR(200) NULL,
    patient_temperature DOUBLE PRECISION NULL,
    danger_signs BOOLEAN NULL,
    malaria_test_result BOOLEAN NULL,
    malaria_treatment_given BOOLEAN NULL
);
